import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";
import Navbar from "./Navbar";

export default function Footer({viewer, setViewer}) {
    // Use state to track which section is active
    // const [viewer, setViewer] = useState(0);

    // Function to update viewer
    const updateHooks = (number) => {
        setViewer(number); // Update the state when a link is clicked
    };

    return (
        <div>
            <footer className="text-body-secondary py-5">
                <div className="container">
                    <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 0, paddingBottom: 0}}>

                        <div style={{display: 'flex', alignItems: 'center', padding: '16px'}}>
                            <p style={{marginRight: '20px'}}>Ames, IA 50011</p>
                            <p>Phone: 515-865-8709</p>
                        </div>
                        
                        <div style={{padding: '16px', textAlign: 'right'}}>
                            <p className="mb-1">
                                {/* Contact Me link triggers the updateHooks function */}
                                <a 
                                    href="#"
                                    style={{color: 'black'}} 
                                    onClick={() => updateHooks(4)} // Calls updateHooks with 4 when clicked
                                >
                                    Contact Me
                                </a>
                                
                                {/* Back to top link */}
                                <a href="#" style={{color: 'black', marginLeft: '2em'}}>Back to top</a>
                            </p>
                        </div>
                    </div>
                    
                    {/* Copyright notice */}
                    <div style={{textAlign: 'center', marginTop: '20px'}}>
                        <p>Â© 2025 Chris Moseley. All Rights Reserved.</p>
                    </div>
                </div>
            </footer>
        </div>
    );
}
